import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import '../styles/LoginECadastro.css';
import { Link } from 'react-router-dom';

const CadastroFreelancer = () => {
    const navigate = useNavigate();
    const [email, setEmail] = useState('');
    const [senha1, setSenha1] = useState('');
    const [nome, setNome] = useState('');
    const [senha2, setSenha2] = useState('');
    const [CNPJ, setCNPJ] = useState('');
    const FuncCadastro = (e) => {
        e.preventDefault();
        if(senha1 != senha2) {
            alert('As senhas devem ser iguais');
        } else {
            if(senha1 == '' || senha2 == '' || nome == '' || email == '' || CNPJ == '') {
                alert('Todos os campos devem estar preenchidos');
            } else {
                alert('Cadastro criado com sucesso');
                navigate('/Login');
            }
        }
    };
    return(
        <div>
            <Header />
            <section id="contact" class="main-bg section">
                <div class="main-content intro-content div-section-zoom">
                    <div class="contact-form-cadastro">
                        <form>
                            <fieldset class="form-grid-cadastro">
                                <h2 class="align-my-text fill-in">Cadastre-se</h2>
                                <div class="form-group">
                                    <label for="email">Email</label>
                                    <input type="email" name="email" id="email" placeholder="Insira seu Email" required/>
                                </div>
                                <div class="form-group">
                                    <label for="nome-pessoa">Nome</label>
                                    <input type="text" name="nome-pessoa" id="nome-pessoa" placeholder="Insira seu nome" required/>
                                </div>
                                <div class="form-group">
                                    <label for="senha">Senha</label>
                                    <input type="password" name="senha" id="senha" placeholder="Insira sua senha" required/>
                                </div>
                                <div class="form-group">
                                    <label for="senha2">Repita a Senha</label>
                                    <input type="password" name="senha2" id="senha2" placeholder="Repita sua senha" required/>
                                </div>
                                <div class="form-group">
                                    <label for="cpf">CPF</label>
                                    <input type="text" name="cpf" id="cpf" placeholder="Insira o CPF" required/>
                                </div>
                                <div class="form-group align-my-text fill-in">
                                    <button type="submit">Criar Conta</button>
                                </div>
                                <div class="form-group align-my-text fill-in">
                                    <p class="reduce-space-little">Já possui uma conta? <Link to='/Login'>Entrar</Link></p>
                                </div>
                                
                            </fieldset>
                        </form>
                        
                    </div>
                    
                </div>
            </section>
            <Footer />
        </div>
    );
};

export default CadastroFreelancer;
